import React from "react";
import Icon1 from "../../images/svg-1.png";
import {
  TeamMemberCard as TeamMemberCard,
  TeamContainer,
  TeamH1,
  TeamH2,
  TeamIcon,
  TeamP,
  TeamWrapper,
  ImgWrap,
  Img,
  TeamH3,
} from "./TeamElements";

export const Team = () => {
  return (
    <TeamContainer id="team">
      <TeamH1>Nasz skład</TeamH1>
      <TeamWrapper>
        <TeamMemberCard>
          <ImgWrap>
            <Img src={require('../../images/_piotrek.jpg').default}  />
          </ImgWrap>
          <TeamH2>Piotr Maestro!</TeamH2>
          <TeamH3>Klawisz, akordeon, wokal, wodzirej</TeamH3>
          <TeamP>Ogromne doświadczenie! Zna wszystkie utwory świata, zagra każdą biesiadę, uwielbia rosyjskie pieśni, prowadzi imprezy dowcipnie i kulturalnie. Prawdziwy Maestro!</TeamP>
        </TeamMemberCard>
      </TeamWrapper>
    </TeamContainer>
  );
};
